import React from "react";
import axios  from "axios"
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            coins : []
        }
        
    }
   
    GetData = () =>{
        var myHeaders = new Headers();
        myHeaders.append("Authorization", "Bearer " +localStorage.getItem('token'));
        var raw = "";
        var requestOptions = {
          method: 'GET',
          headers: myHeaders,
          body: raw,
          redirect: 'follow'
        }; 
        return axios.get("http://localhost:8089/api/coin/getAllCoin", requestOptions); 
    }
    componentDidMount(){
        this.getCoin().then((response) =>{
            this.setState({coins : response.data})
        })
    }
    render(){
        return 
        <div> 
            <h1>Coin List</h1>
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>
    }
}
